export const LIST_VIEW = 'list'
export const CHART_VIEW = 'chart'
export const TYPE_INCOME = 'income'
export const TYPE_OUTCOME = 'outcome'

export const padLeft = (n) => {
	return n < 10 ? '0' + n : n
}

export const range = (size, startAt) => {
	const arr = []
	for (let i = 0; i < size; i++) {
		arr[i] = startAt + i
	}
	return arr
}
